import React, { Component } from 'react'
import {Layout} from 'antd'
import { Redirect } from 'react-router'
import { Link } from 'react-router-dom'

import storageUtils from '../../utils/storageUtils'

const {Header} = Layout
export default class DevHead extends Component {

    logout=()=>{

    }
    render() {
        const admin = storageUtils.getUser()
        const token = storageUtils.getToken()
        if(!token || !admin){
            return <Redirect to='/dev/login'/>
        }
        return (
            <div>
                <Header className="head">订票系统运维平台
                <span style={{ marginLeft: '800px', fontSize: '15px' }}>{admin.name}
                <Link to="/dev/login" onClick={this.logout} style={{ marginLeft: '20px' }}>退出登录</Link></span></Header>
            </div>
        )
    }
}
